import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="wrapper">
<ul>
  <li><a class="active" href="#home">Home</a></li>
  <li><a href="#news">News</a></li>
  <li><a href="#contact">Contact</a></li>
  <li style="float:right"><a href="#about">About</a></li>
</ul>
    </div>
  );
}

export default App;
